import React from 'react';
import errorMessages from './error-messages';
import spinner from './spinner.svg';
import { fetchLists } from './services';

const users = (usersList) => {
    const userList = {};
    fetchLists()
    .then( (usersMessagesList) => {
        console.log(usersMessagesList);
      userList = usersMessagesList.usersList; // inform parent
    })
    .catch( (err) => {
    //   setError(errorMessages[err.code || 'DEFAULT']);
    //   setIsLoading(false);
    });

    return (
        <div>
            { `<ul className="users">` +
                Object.values(userList).filter( user => user.active).map( user => `
                <li>
                    <div className="user">
                        <span className="username">${user.username}</span>
                    </div>
                </li>
                `).join('') +
            `</ul> `}
        </div>
    )
}
export default users
